window.bookSummaryJSON = "<p>I don't kneel for any man. Not anymore. </p> <p>I had the perfect dominant boyfriend. Then Cortez left me to save the world. </p> <p>After two-and-a-half lost drowning my misery in bad decisions, one man changed everything. Rogan is the perfect submissive, who puts me back in control of both him and my life. </p> <p>Until Cortez comes home. </p> <p>Who am I? Cortez's bottom or Rogan's top? </p> <p>Maybe I'm both. </p> <p>Maybe I was made to be their middleman.</p>"; 
